import React from "react";

import bgImg from "../3_images/1_home/bg_home2.jpg";
import bgLogo from "../3_images/1_home/icon_home-big.png";

import Line from "../0_components/2_module/Line";

import { HomeStyle } from "../2_styles/1_layout/HomeStyle";

export default function Home() {
  return (
    <HomeStyle bgImg={bgImg} bgLogo={bgLogo}>
      <div className="box">
        <div className="bgImg"></div>
        <div className="bgLogo"></div>
        <div className="title">
          <p>the</p>
          <p>avengers</p>
          <Line width="50%" />
        </div>
      </div>
    </HomeStyle>
  );
}
